import './app.scss';
import AuthForms from './components/AuthForms.jsx';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
function App() {
  return (
    <>
    <Router>
      <div className='main'>
        <Routes>
          <AuthForms/>
          <Route exact path="/Authentication" element = {<AuthForms />}/>
        </Routes>
      </div>
    </Router>
    </>
  );
}

export default App;
